import * as React from 'react';
import "../css/contact.css";
import NavBar from '../dynamic/NavBar';
import LocationOnIcon from '@mui/icons-material/LocationOn';

import GoogleMapReact from 'google-map-react';

//45.78957948271175, 24.11837126816556

const location = {address:'Str.E.A.Bielz Nr.60 Sibiu',lat: 45.78957948271175, lng: 24.11837126816556,};

const Map = ({ location, zoomLevel }) => (
    <div className="map">
      <h2 className="map-h2">Come Visit Us At Our Campus</h2>
  
      <div className="google-map">
        <GoogleMapReact
          bootstrapURLKeys={{ key: '' }}
          defaultCenter={location}
          defaultZoom={zoomLevel}
        >
          <LocationPin
            lat={location.lat}
            lng={location.lng}
            text={location.address}
          />
        </GoogleMapReact>
      </div>
    </div>
  )

  const LocationPin = ({ text }) => (
    <div className="pin">
      {/* <LocationOnIcon  className="pin-icon" /> */}
      <p className="pin-text">{text}</p>
    </div>
  )

function Contact(){
return(
    <div id='contactContainer'>
        <NavBar/>
        <div id='contentContainer'>
           <div id = "mapContainer">
           <div className="google-map-code">
          <Map location={location} zoomLevel = {17}></Map>
        </div>
           </div>
        </div>
    </div>
);
}

export default Contact;
